import './App.css';

function App() {

  const [list, setList] = useState([]);


  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/posts')
      .then(response => response.json())
      .then((data) => {
        setList(data);
      });
  }, []);







  return (
    <div className="App">






    </div>
  );
}

export default App;
